import React from "react";
import { Footer } from "../components/Footer/footer";
import { Nava } from "../components/Nav/nav";
import { Container, Col, Row } from "react-bootstrap";


function Noticias(){
    return(
        <>
        <Nava></Nava>
        <Container>
            <Row>
                <Col>
                <img width={'100%'} src='https://sapiencia.gov.co/wp-content/uploads/2023/05/fotos-fondos-sapiencia-2023-2.jpg'/>
                </Col>
                <Col>
                <img width={'80%'} src='https://sapiencia.gov.co/wp-content/uploads/2023/05/fotos-fondos-sapiencia-2023-2.jpg'/></Col>
            </Row>
           
        </Container>
        <Footer></Footer>
        </>
    )
}

export {Noticias}
